const ImageContainerHoempage = () => {
  return (
    <div className='containerr'>
        <div className='sm:flex gap-[3vw]'>
            <div className='sm:w-1/2'>
                <h2 className='text-[24px] sm:text-[36px] lg:[48px] text-[white]'>TITLE - Our Latest Car</h2>

            </div>
        </div>
    </div>
  )
}

export default ImageContainerHoempage
